import styled from "styled-components";
import { theme } from "../../styles/theme/theme";

export const Container = styled.div`
  position: absolute;
  top: 0;
  left: 0;

  width: 100vw;
  height: 100vh;

  display: flex;
  justify-content: center;
  align-items: center;

  background-color: ${theme.colors.border.mainDark};
`;
